import React, { useState } from "react";
import { CREATE_JOB_MUTATION } from "../GraphQL/Mutations";
import { useMutation } from "@apollo/client";

function AddNewJob() {
  const [company, setCompany] = useState("");
  const [logo, setLogo] = useState(
    "data:image/png;base64,"
  );
  const [isNew, setIsNew] = useState(true);
  const [isFeatured, setIsFeatured] = useState(true);
  const [position, setPosition] = useState("");
  const [level, setLevel] = useState("");
  const [contract, setContract] = useState("");
  const [location, setLocation] = useState("");
  const [languages, setLanguages] = useState(["java", "Python"]);
  const [description, setDescription] = useState("");

  const [createJob, { error }] = useMutation(CREATE_JOB_MUTATION);

  const addJob = () => {
    createJob({
      variables: {
        company: company,
        logo: logo,
        isNew: isNew,
        isFeatured: isFeatured,
        position: position,
        level: level,
        contract: contract,
        location: location,
        languages: languages,
        description: description,
      },
    });

    if (error) {
      console.log(error);
    }
  };
  return (
    <div>
      <input
        type="text"
        placeholder="Enter Company Name"
        onChange={(e) => {
          setCompany(e.target.value);
        }}
      />
      <input
        type="text"
        placeholder="Enter Position"
        onChange={(e) => {
          setPosition(e.target.value);
        }}
      />
      <input
        type="text"
        placeholder="Enter Level e.g. Junior"
        onChange={(e) => {
          setLevel(e.target.value);
        }}
      />
      <input
        type="text"
        placeholder="Enter Contract e.g. fulltime"
        onChange={(e) => {
          setContract(e.target.value);
        }}
      />
      <input
        type="text"
        placeholder="Enter Location"
        onChange={(e) => {
          setLocation(e.target.value);
        }}
      />

      <input
        type="text"
        placeholder="Enter Description about Job"
        onChange={(e) => {
          setDescription(e.target.value);
        }}
      />

      <button onClick={addJob}>Add New Job</button>
    </div>
  );
}

export default AddNewJob;
